def decrypt_data(key_data, private_key):
    rsa_cipher = PKCS1_OAEP_Cipher.new(private_key)
    decrypted_data = bytearray()
    chunk_size = 256
    for i in range(0, len(key_data), chunk_size):
        chunk = key_data[i:i+chunk_size]
        decrypted_data.extend(rsa_cipher.decrypt(chunk))
    return bytes(decrypted_data)

